// code for subroutines (not shown)

void plot_pixel(int x, int y, short int line_color)
{
    volatile short int *one_pixel_address;
        
        one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
        
        *one_pixel_address = line_color;
}

void wait_for_vsync()
{
	volatile int * pixel_ctrl_ptr = (int *) 0xff203020; // base address
	int status;
	*pixel_ctrl_ptr = 1; // start the synchronization process
	// write 1 into front buffer address register
	status = *(pixel_ctrl_ptr + 3); // read the status register
	while ((status & 0x01) != 0) // polling loop waiting for S bit to go to 0
	{
		status = *(pixel_ctrl_ptr + 3);
	} // loop/function exits when status bit goes to 0
}

void clear_screen(){
    for(int i = 0; i < 512; i++){
        for(int j = 0; j< 240; j++){
            plot_pixel(i, j, 0x0);
        }
    }
}

void draw_line(int start_x, int start_y, int end_x, int end_y, short int line_color){
    bool steep = abs(end_y - start_y) > abs(end_x - start_x);
    int y_step;
    if( steep ){
        swap(&start_x, &start_y);
        swap(&end_x, &end_y);
    }
    if(start_x>end_x){
        swap(&start_x, &end_x);
        swap(&start_y, &end_y);
    }

    int dx = end_x - start_x;
    int dy = abs(end_y - start_y);
    int error = -(dx/2);
    int y = start_y;

    if(start_y < end_y){
        y_step = 1;
    }else{
        y_step = -1;
    }

    while(start_x != end_x){
        if(steep){
            plot_pixel(y, start_x, line_color);
        }
        else{
            plot_pixel(start_x, y, line_color);
        }
        error +=dy;
        start_x++;
        if(error > 0){
            y += y_step;
            error -= dx;
        }
    }
    
}

void swap(int* first, int*second){
    int temp = *first;
    *first = *second;
    *second = temp;
}




